import React from 'react';

function TODOList(){
    const nullTask = ["nothing to do"]
    const [tasks, setTasks] = React.useState(nullTask);
    return(
        <div>
            <h1>ToDo List</h1>
            {tasks.map((task) =>{
                return <div key={task}></div>;
            })}
        </div>  
    )
}

export default TODOList;
